import React, { useState, useEffect } from 'react';
import { View, Text, Image, TextInput, ScrollView } from 'react-native';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import { HeaderRequisicao, DadosUsuario } from '../../AuthContext';

function EditarUsuario() {
  const navigation = useNavigation();

  const [userId, setUserId] = useState('');
  const [nome, setNome] = useState('');
  const [sobrenome, setSobrenome] = useState('');
  const [data_de_nasc, setData_de_nasc] = useState('');
  const [cpf, setCpf] = useState('');
  const [sexo, setSexo] = useState('');
  const [celular, setCelular] = useState('');
  const [email, setEmail] = useState('');
  const [senha, setSenha] = useState('');
  const [preco, setPreco] = useState('');
  const [link, setLink] = useState('');
  const [cep, setCep] = useState('');
  const [endereco, setEndereco] = useState('');
  const [cidade, setCidade] = useState('');
  const [estado, setEstado] = useState('');
  const [bairro, setBairro] = useState('');
  const [descricao, setDescricao] = useState('');
  const [imagem, setImagem] = useState('');

  async function MostrarUsuario() {
    const userData = await DadosUsuario();
    const headers = await HeaderRequisicao();
    const url = `https://localhost:44396/api/ConfigUsu?id=${userData.ID}`;

    fetch(url, {
      method: 'GET',
      headers,
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        if (data.length > 0) {
          const usuario = data[0];
          setUserId(usuario.id || '');
          setNome(usuario.nome || '');
          setSobrenome(usuario.sobrenome || '');
          setData_de_nasc(usuario.data_de_nasc || '');
          setCpf(usuario.cpf || '');
          setSexo(usuario.sexo || '');
          setCelular(usuario.celular || '');
          setEmail(usuario.email || '');
          setSenha(usuario.senha || '');
          setPreco(usuario.preco || '');
          setLink(usuario.link || '');

          setCep(usuario.cep || '');
          setEndereco(usuario.endereco || '');
          setCidade(usuario.cidade || '');
          setEstado(usuario.estado || '');
          setBairro(usuario.bairro || '');

          setDescricao(usuario.descricao || '');
          setImagem(usuario.imagem || '');
        }
      })
      .catch((error) => {
        console.log(error);
        alert('Erro ao inserir informações');
      });
  }

  useEffect(() => {
    MostrarUsuario();
  }, []);

  function Editar() {
    const body = {
      id: userId,
      nome,
      sobrenome,
      data_de_nasc,
      cpf,
      sexo,
      celular,
      email,
      senha,
      cep,
      endereco,
      cidade,
      estado,
      bairro,
      descricao,
      imagem,
    };

    fetch('https://localhost:44396/api/invisivelcui', {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(body),
    })
      .then(() => {
        alert('Usuário editado com sucesso');
      })
      .catch((error) => {
        console.log(error);
        alert('Erro ao editar resultado');
      });
  }

  function Editar_Navegar() {
    Editar();
    Navegar();
  }

  function Navegar() {
    navigation.navigate('Routes2');
  }

  function handleNomeChange(event) {
    setNome(event.target.value);
  }

  function handleSobrenomeChange(event) {
    setSobrenome(event.target.value);
  }

  function handleDataDeNascChange(event) {
    setData_de_nasc(event.target.value);
  }

  function handleCpfChange(event) {
    setCpf(event.target.value);
  }

  function handleSexoChange(event) {
    setSexo(event.target.value);
  }

  function handleCelularChange(event) {
    setCelular(event.target.value);
  }

  function handleEmailChange(event) {
    setEmail(event.target.value);
  }

  function handleSenhaChange(event) {
    setSenha(event.target.value);
  }

  function handlePrecoChange(event) {
    setPreco(event.target.value);
  }

  function handleLinkChange(event) {
    setLink(event.target.value);
  }

  function handleCEPChange(event) {
    setCep(event.target.value);
  }

  function handleEnderecoChange(event) {
    setEndereco(event.target.value);
  }

  function handleCidadeChange(event) {
    setCidade(event.target.value);
  }

  function handleEstadoChange(event) {
    setEstado(event.target.value);
  }

  function handleBairroChange(event) {
    setBairro(event.target.value);
  }

  function handleDescricaoChange(event) {
    setDescricao(event.target.value);
  }

  return (
    <ScrollView>
      <View style={styles.container}>
        <Text style={styles.title}>Olá, Usuário!</Text>
        <View style={styles.view}>
          <Text style={styles.title}>Informações pessoais</Text>

          <Text style={styles.text}>Imagem</Text>
          <Image
            source={{ uri: imagem }}
            style={styles.image}
            resizeMode="cover"
          />

          <Text style={styles.text}>Nome</Text>
          <TextInput
            style={styles.input}
            value={nome}
            onChangeText={handleNomeChange}
          />

                    <Text style={styles.text}>Sobrenome</Text>
                    <TextInput style={styles.input}
                        value={sobrenome}
                        onChangeText={handleSobrenomeChange}
                    />

                    <Text style={styles.text}>Data de Nascimento</Text>
                    <TextInput style={styles.input}
                        value={data_de_nasc}
                        onChangeText={handleDataDeNascChange}
                    />

                    <Text style={styles.text}>CPF</Text>
                    <TextInput style={styles.input}
                        value={cpf}
                        onChangeText={handleCpfChange}
                    />

                    <Text style={styles.text}>Sexo</Text>
                    <TextInput style={styles.input}
                        value={sexo}
                        onChangeText={handleSexoChange}
                    />

                    <Text style={styles.text}>Celular</Text>
                    <TextInput style={styles.input}
                        value={celular}
                        onChangeText={handleCelularChange}
                    />

                    <Text style={styles.text}>Email</Text>
                    <TextInput style={styles.input}
                        value={email}
                        onChangeText={handleEmailChange}
                    />

                    <Text style={styles.text}>Senha</Text>
                    <TextInput style={styles.input}
                        value={senha}
                        onChangeText={handleSenhaChange}
                    />

                    <Text style={styles.text}>Preço</Text>
                    <TextInput style={styles.input}
                        value={preco}
                        onChangeText={handlePrecoChange}
                    />

                    <Text style={styles.text}>Link</Text>
                    <TextInput style={styles.input}
                        value={link}
                        onChangeText={handleLinkChange}
                    />

                    <Text style={styles.text}>Descrição</Text>
                    <TextInput style={styles.inputDesc} multiline
                        value={descricao}
                        onChangeText={handleDescricaoChange}
                    />

                    <Text style={styles.title}>Localidade</Text>
                    <Text style={styles.text}>CEP</Text>
                    <TextInput style={styles.input}
                        value={cep}
                        onChangeText={handleCEPChange}
                    />

                    <Text style={styles.text}>Endereço</Text>
                    <TextInput style={styles.input}
                        value={endereco}
                        onChangeText={handleEnderecoChange}
                    />

                    <Text style={styles.text}>Cidade</Text>
                    <TextInput style={styles.input}
                        value={cidade}
                        onChangeText={handleCidadeChange}
                    />

                    <Text style={styles.text}>Estado</Text>
                    <TextInput style={styles.input}
                        value={estado}
                        onChangeText={handleEstadoChange}
                    />

                    <Text style={styles.text}>Bairro</Text>
                    <TextInput style={styles.input}
                        value={bairro}
                        onChangeText={handleBairroChange}
                    />

                    <RectButton style={styles.button} onPress={Editar_Navegar}>
                        <Text style={styles.buttonText}>Salvar Alterações</Text>
                    </RectButton>
                </View>
            </View>
        </ScrollView>
    );
}

export default EditarUsuario;
